import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './GameCard.css'

const GameCard = () => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col className="mt-4">
          <Card>
            <p>gh</p>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default GameCard;
